const venusDeMiloCollection = {
    collectionDescription: [
        "Venus. The goddess of love’s name resonates from the forming of myths into the present day—even finding a place in teenagers’ imaginations. Why? This series of ten oil paintings explores that fascinating question.",
        "My tale starts with the goddesss origin in the mists of time. Then we experience the creation and later rediscovery of her most influential manifestation, the “disarmed” Greek statue, the Venus de Milo. The final painting brings her into the modern day.",
        "The initial, and most essential, inspiration for these paintings came from my daughter. As her “Odyssey of the Mind” project at Newark High School (DE), she and her teammates created a performance focusing on the Venus de Milo. Caroline submitted to being life-cast to re-create the sculpture. As my daughter researched the topic, I became increasingly drawn to the history/herstory of this icon. Then I discovered the book 'Disarmed: A Story of the Venus de Milo' by Gregory Curtis. And I began to think about recreating this story through my own artistic perspective.",
        "My approach links a number of my influences and interests. My first thought was to create a graphic novel – comic books intrigue me as a storytelling medium. Later I decided to tell the story through a series of tableaus, the way Hogarth did in his Rake's Progress. Eight of the pieces are inspired by Rembrandt drawings, which influenced the paintings in terms of composition and structure. Two are based on woodcuts that illustrated the 1939 book on the rediscovery of the statue, 'La Venus de Milo et Olivier Voutier' by Jean-Paul Alaux.",
        "On my palette (a large sheet of glass) I create “pools” of color, and often spend hours just mixing them to find the right “warm” green or flesh tone —the one that supports the story I have in mind and enhances the drama. Using this range of shades, I draw with the paint, moving tiny amounts of pigment around the surface of the canvas. As I work, iconography, symbols, and natural features appear, dissolve and reappear, often viewed from different perspectives. They provide clues and emphasis, and link the segments of the story together, even if the viewer does not consciously “recognize” them. I also focused on the way the paintings are staged and the way the figures stand, with their well-defined legs and feet. This gives them a feeling of permanence and presence, and keeps them grounded in their surroundings. As I worked on this series, I was surprised by how far removed the paintings have become from the drawings and woodcuts that inspired them. The story itself forced me to change the paintings! By retelling the stories of the past, we can see how they affect the present.",
        "My paintings are a way to connect with our tribal history in a visual form, to explore the value of beauty, to answer the question of why an ageless myth and a statue nearly 2,000 years old remain a definition of beauty for us"
    ]
};
